@LJAkaar67 @PinkyD124 Melania turned the Rose Garden into a rally venue. 

Inhanced audio, camera spots, chair and podium. Took down the shade trees. Took out all the color. 

I would like to see it returned to a garden.

@YouthfulNyxxx She frowned as she leaned much more forward, now if Nyx's eyes wander, she'll see everything that Shade had in her top.

"Of course I have tomes to teach. But I do think you're not looking for these."

She pulls out Heal, Recover, Fire, Thunder, and Wind tome and staves.
